import React from 'react';
import { Flex, Progress, Card, Space,Typography } from 'antd';


export const Charp = () => (
  <Flex  style={{ marginTop: 12, marginLeft:1 }} gap="middle" vertical>
   
  
    
   

    <Space  size={16}>
  <Card 
    
   
    style={{
      width: 500,
    }}
  ><Typography.Title level={5}>Custom count:</Typography.Title>
      <Progress className='px-2 ' size={[120, 20]} strokeWidth={20} steps={8} type="dashboard" percent={50} status="active" />
   
      <Progress className='px-2 ' size={[120, 20]}  strokeWidth={20} steps={8} type="dashboard"  percent={70} status="active" />
     
      <Progress  className='px-2 ' size={[120, 20]}  strokeWidth={20} steps={8} type="dashboard"  percent={70} status="active" />
      <div><Typography className='px-2 ' level={5}>Custom count:</Typography>
      <Typography className='px-2 'level={5}>Custom count:</Typography>
      <Typography level={5}>Custom count:</Typography>
      </div>
  </Card>
  
</Space>
  </Flex>
  
)
